import "./../Styles/Login.css";
import { Link } from "react-router-dom";
import { Container, Row, Col } from "reactstrap";
import userIcon from "../assets/images/user.png";
const login = () => {
  return (
    <>
      <section>
        <Container>
          <Row>
            <Col lg="12"></Col>
          </Row>
        </Container>
      </section>
    </>
  );
};
export default login;

